import React, { useState, useEffect } from 'react';
import ProductList from '../components/ProductList';

const Home = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    // Fetch products from backend or use sample data
    // For now, using sample static data
    const sampleProducts = [
      { id: 1, name: 'Smartphone', price: 15000 },
      { id: 2, name: 'Laptop', price: 55000 },
      { id: 3, name: 'Headphones', price: 2000 },
      { id: 4, name: 'Smartwatch', price: 8000 },
      { id: 5, name: 'Camera', price: 25000 },
    ];
    setProducts(sampleProducts);
  }, []);

  return (
    <div className="page home-page">
      <h1>Welcome to ShopSphere</h1>
      <p>Discover the best electronics and gadgets at unbeatable prices.</p>
      <ProductList products={products} />
    </div>
  );
};

export default Home;
